	module.exports = {"title":"Playfair Cipher","date":"2017-06-01T22:40:32.169Z","layout":"post","path":"/ctf/playfair-cipher/","category":"CTF","tile":"md-tile","color":"ctf","readTime":"20","description":"This challenge presented an all new cipher and algorithm for me to learn.  Once I understood both, I was able to decrypt the ciphertext.","body":"<div class='daily-hack-box'>\n\t<table class='table'>\n\t\t<thead>\n\t\t</thead>\n\t\t<tbody>\n\t\t\t<tr>\n\t\t\t\t<th scope='row'>Challenge</th>\n\t\t\t\t<td>Decrypt the attached ciphertext.</td>\n\t\t\t</tr>\n\t\t\t<tr>\n\t\t\t\t<th scope='row'>Method</th>\n\t\t\t\t<td>Simulated Annealing Algorithm</td>\n\t\t\t</tr>\n\t\t\t<tr>\n\t\t\t\t<th scope='row'>Link</th>\n\t\t\t\t<td>\n                    <a class='table-link' target='_blank' href='http://dl.ctf.rocks/fairplay.tar.gz'>http://dl.ctf.rocks/fairplay.tar.gz</a>\n                </td>\n\t\t\t</tr>\n\t\t\t<tr>\n\t\t\t\t<th scope='row'>Flag</th>\n\t\t\t\t<td>\n                SCTF{PLAYFAIRISAFUNCIPHERTOCRACKDONTYOUTHINKSO}\n                </td>\n\t\t\t</tr>\n\t\t\t<tr>\n\t\t\t\t<th scope='row'>Sources</th>\n\t\t\t\t<td>\n                <a class='table-link' target='_blank' href='http://practicalcryptography.com/cryptanalysis/stochastic-searching/cryptanalysis-playfair/'>Practical Cryptography</a>\n                </td>\n\t\t\t</tr>\n\t\t</tbody>\n\t</table>\n</div>\n<h3>Daily Hack #8 Writeup</h3>\n<p>I joined the 2017 <a class='table-link' target='_blank' href='https://securityfest.ctf.rocks'>SecurityFest CTF</a> during a boring meeting and ended up playing it throughout the night.  This would be a good CTF for a security team, lots of diverse questions, highly recommend it.  This challenge ended up being a PlayFair cipher challenge.  I was greeted with the following message and the below ciphertext.</p>\n<figure>\n    <img style=\"height: 240px;\" src=\"./playfair-challenge.png\" alt=\"Playfair Challenge Statement\">\n    <figcaption>Playfair Challenge Statement</figcaption>\n</figure>\n<br>\n<pre><code>....\n</code></pre>\n<figure>\n    <figcaption>Ciphertext (Concatenated for Brevity)</figcaption>\n</figure>\n<br>\n<p>The challenge statement indicated that this was a Playfair cipher, something that I was totally not familiar before approaching this problem.  <em>(Side note, that’s one of the things I love about CTFs - you get exposure to stuff you’ve never seen before.)</em></p>\n<p>I had to do some research about Playfair ciphers and right away it was apparent that I would need to likely brute force the grid used to encrypt.  There are not a lot of good online tools for brute forcing Playfair cipher grids.  However, there was an interesting academic algorithm that seemed to make the most sense to me.</p>\n<p>I found this method on <a class='table-link' target='_blank' href='http://practicalcryptography.com/cryptanalysis/stochastic-searching/cryptanalysis-playfair/'>Practical Cryptography</a>’s website that discussed a simulated annealing algorithm.</p>\n<br>\n<p><em>Stealing from Wikipeida:</em></p>\n<div class='text-response'>\n\tSimulated annealing (SA) is a probabilistic technique for approximating the global optimum of a given function. Specifically, it is a metaheuristic to approximate global optimization in a large search space. It is often used when the search space is discrete.\n</div>\n<p><em>So, to translate why this algorithm would help us brute force a Playfair grid:</em></p>\n<div class='text-response'>\n\tEach time we attempt a grid solution, we approximate the accuracy of the soluion.  In this case, the accuracy of English words in the decrypted ciphertext.\n</div>\n<p>Okay, now that I understand what this is doing, I pull the files off of the Practical Cryptography’s website.</p>\n<ul>\n\t<li>playfaircrack.c </li>\n\t<li>scoreText.h</li>\n\t<li>scoreText.c</li>\n\t<li>qgr.h</li>\n</ul>\n<p>I edit <code>playfaircrack.c</code> and change the ciphertext array to:</p>\n<pre><code>char cipher[]  = <span class=\"hljs-string\">\"FMYTFQUZMLMYRPELOAEKHARPOSRNQOKMQMXGYHOYMDSHYOGDVSYZMEFKKQQOVRBAFEVFFMZDCMVHFAWPHATWDZAHWRFMXKFYCSTXPBXMYBEKHZRDHMZWSHRDQHWZNRUMBAKAMKFAMLFYFRZXKAFKNR\"</span><span class=\"hljs-comment\">;    </span>\n</code></pre>\n<p>That’s obviously not entire ciphertext, but I assume if I find a proper grid and the flag is not within the first 150 characters, I can solve the rest with the grid.  Next, I compile as they tell me:</p>\n<pre><code>gcc -O3 -lm playfaircrack<span class=\"hljs-selector-class\">.c</span> scoreText<span class=\"hljs-selector-class\">.c</span> -o pfc\n</code></pre>\n<p>And finally run the program - which finds the solution instantly!</p>\n<figure>\n    <img style=\"height: 120px;\" src=\"./playfair-solution.png\" alt=\"Playfair Solution\">\n    <figcaption>Playfair Solution</figcaption>\n</figure>\n<br>\n<p>So the flag is:</p>\n<pre><code><span class=\"xml\">SCTF</span><span class=\"hljs-template-variable\">{PLAYFAIRISAFUNCIPHERTOCRACKDONTYOUTHINKSO}</span><span class=\"xml\">\n</span></code></pre>\n<p>I have to admit, at first I tried running this program with the entire cipher text, then under 100 characters, then finally with 150 characters of the ciphertext.  The latter obviously worked the best.  I’m excited to use more simulated annealing algorithms in the future, maybe for a fun challenge, I’ll translate this to python!</p>\n<br>\n"}

